    single-beam bathymetry data for field activity K-2-93-HW in Kauai, Hawaii from 02/27/1993
    to 03/02/1993",nt"tracking_summary": {ntt"total": 1,ntt"recent":
    1nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2016-02-10T06:15:59.224958",nt"name": "k293hw-m77t-and-k293hw-h77t-mgd77t-data-and-header-files-for-single-beam-bathymetry-dat-02-19932c459",nt"isopen":
    false,nt"url": null,nt"notes": "Single-beam bathymetry data along with
    GPS navigation data was collected as part of the U.S. Geological Survey cruise K-2-93-HW.
    The cruise was conducted in Kauai, Hawaii from February 27 to March 2, 1993. The
    chief scientist was Monty Hampton from the USGS Coastal and Marine Geology office
    in Menlo Park, CA. The purpose of this cruise was to create a detailed bathymetric
    map of the Mamala Bay seafloor that delimits the general extent of the acoustically-resolvable
    dredged material deposits. The geophysical source is unknown. These data are reformatted
    from space-delimited ASCII text files located in the Coastal and Marine Geology
    Program (CMGP) InfoBank field activity catalog at http://walrus.wr.usgs.gov/infobank/k/k293hw/html/k-2-93-hw.meta.htmlinto
    MGD77T format provided by the NOAA's National Geophysical Data Center(NGDC). The
    MGD77T format includes a header (documentation) file (.h77t) and a data file (.m77t).
    More information regarding this format can be found in the publication listed in
    the Cross_reference section of this metadata file.",nt"license_title": null,nt"extras":
